// import List from "./List";
import * as ass from "./Heading";
import * as cal from "./Cal.jsx";
import './index.css';
import Srdata from "./Srdata";

function Calapp(){
    return (
    <>
        <div className="header">
        <ass.default/>
        <h1>add {cal.default(40,10)}</h1>
        <h1>sub {cal.sub(40,10)}</h1>
        <h1>mul {cal.mul(40,10)}</h1>
        <h1>div {cal.div(10,3)}</h1>
        </div>
    </>
    );
    
}

function Cardapp(){
    return (
        <>
            <ass.Card
                imgsrc = {Srdata[0].imgsrc}
                title = {Srdata[0].title}
                link = {Srdata[0].link}
                catorg = {Srdata[0].catorg}
            />
                        <ass.Card
                imgsrc = {Srdata[1].imgsrc}
                title = {Srdata[1].title}
                link = {Srdata[1].link}
                catorg = {Srdata[1].catorg}
            />
                        <ass.Card
                imgsrc = {Srdata[2].imgsrc}
                title = {Srdata[2].title}
                link = {Srdata[2].link}
                catorg = {Srdata[2].catorg}
            />
                        <ass.Card
                imgsrc = {Srdata[3].imgsrc}
                title = {Srdata[3].title}
                link = {Srdata[3].link}
                catorg = {Srdata[3].catorg}
            />
        </>
    )
}



export default Cardapp;
